import Vue from "vue";
import VueRouter from "vue-router";
import UsersDashboard from "../Users-Frontend/Components/ise/UsersDashboard.vue";

Vue.use(VueRouter);

const routes = [{ path: "/Users", component: UsersDashboard }];

const router = new VueRouter({
  routes,
});

export default router;
